import React, { useState, useEffect, useRef } from 'react';
import { Button } from 'primereact/button';
import { InputText } from 'primereact/inputtext';
import { InputTextarea } from 'primereact/inputtextarea';
import { Chart } from 'primereact/chart';
import { DataTable } from 'primereact/datatable';
import { Column } from 'primereact/column';
import FinancialYearService from '../service/FinancialYearService';


const chartData = {
    labels: ['January', 'February', 'March'],
    datasets: [
        {
            label: 'Expenses',
            data: [7, 12, 15, 5, 3, 13, 21],
            borderColor: ['#FFB300'],
            borderWidth: 3,
            fill: false,
            pointRadius: [4, 6, 4, 12, 8, 0, 4],
            tension: 0.4
        },
        {
            label: 'New Users',
            data: [3, 7, 2, 17, 15, 13, 19],
            borderColor: ['#66BB6A'],
            borderWidth: 3,
            fill: false,
            tension: 0.4
        }
    ]
};

const chartOptions = {
    responsive: true,
    hover: {
        mode: 'index'
    },
    scales: {
        x: {
            display: true,
            title: {
                display: true,
                text: 'Month'
            }
        },
        y: {
            display: true,
            title: {
                display: true,
                text: 'Value'
            }
        }
    }
};

const Dashboard = () => {
    // const [finances, setFinances] = useState([]);

    // useEffect(() => {
    //     const financeService = new FinancialYearService();
    //    financeService.getFinances().then((data) => setFinances(data));
    // }, []);

    return (
        <div className="layout-dashboard">
            <div className="grid" style={{justifyContent: 'space-evenly'}}>

                <div className="col-12 lg:col-8 xl:col-4">
                    <div className="overview-box sales">
                        <i className="overview-icon pi pi-users"></i>
                        <span className="overview-title">Clients</span>
                        <i className="overview-arrow pi pi-chevron-circle-up"></i>
                        <div className="overview-numbers">50</div>
                        <div className="overview-subinfo">More Details</div>
                    </div>
                </div>
                <div className="col-12 lg:col-8 xl:col-4" >
                    <div className="overview-box views">
                        <i className="overview-icon pi pi-shopping-cart"></i>
                        <span className="overview-title">Products</span>
                        <i className="overview-arrow pi pi-chevron-circle-up"></i>
                        <div className="overview-numbers">200</div>
                        <div className="overview-subinfo">More Details</div>
                    </div>
                </div>
                <div className="col-12 lg:col-6 xl:col-3">
                    <div className="overview-box users">
                        <i className="overview-icon pi pi-users"></i>
                        <span className="overview-title">Payments</span>
                        <i className="overview-arrow pi pi-chevron-circle-up"></i>
                        <div className="overview-numbers">9522</div>
                        <div className="overview-subinfo">7% more than yesterday</div>
                    </div>
                </div>
            </div>
                <div className="col-12 xl:col-12">
                    <div className="card card-w-title global-sales">
                        <h5>Recently Added Clients</h5>
                        <DataTable  paginator rows={5} className="p-datatable-products">
                            <Column field="name" header="Name" ></Column>
                            <Column field="location" header="Location" ></Column>
                            <Column field="contact" header="Contact" ></Column>
                            <Column bodyStyle={{ textAlign: 'center' }} body={() => <Button type="button" icon="pi pi-search"></Button>}></Column>
                        </DataTable>
                    </div>
                </div>

                <div className="col-12 xl:col-12">
                    <div className="card card-w-title global-sales">
                        <h5>Pending Requisitions</h5>
                        <DataTable  paginator rows={5} className="p-datatable-products">
                            <Column field="name" header="ID" ></Column>
                            <Column field="location" header="Title" ></Column>
                            <Column field="contact" header="Description" ></Column>
                            <Column field="contact" header="Product Name" ></Column>
                            <Column field="contact" header="Quantity" ></Column>
                            <Column field="contact" header="Options" ></Column>
                            <Column bodyStyle={{ textAlign: 'center' }} body={() => <Button type="button" icon="pi pi-search"></Button>}></Column>
                        </DataTable>
                    </div>
                </div>

                <div className="col-12 xl:col-12">
                    <div className="card card-w-title global-sales">
                        <h5>Most Recent Payments</h5>
                        <DataTable  paginator rows={5} className="p-datatable-products">
                            <Column field="name" header="Ref NO." ></Column>
                            <Column field="location" header="Client Name" ></Column>
                            <Column field="contact" header="Product Name" ></Column>
                            <Column field="contact" header="Amount" ></Column>
                            <Column field="contact" header="Quantity" ></Column>
                            <Column field="contact" header="Options" ></Column>
                            <Column bodyStyle={{ textAlign: 'center' }} body={() => <Button type="button" icon="pi pi-search"></Button>}></Column>
                        </DataTable>
                    </div>
                </div>
            </div>
    );
};

export default Dashboard;
